  constructor(props: {}) {
    super(props);
    this.state = {
      messages: DUMMY_DATA
    }
  }

  render() {
    return(

      <div className="app">
        <Header/>
        <MessageList messages={this.state.messages}/>
      </div>

    )
  }

}

export default App;
